import React, { useEffect, useState } from "react";
function Home(){
    const navList = ['img/navImg1.jpeg', 'img/navImg2.jpeg', 'img/navImg3.jpeg']
    const [navIndex, setNavindex]  = useState(1);
    useEffect((navIndex) => {
        setInterval((setNavindex) => navIndex + 1, 3000);
    })

    return(
        <div>
            <header className="header">
                <h1>조물주 위에 막걸리</h1>
            </header>
            <nav className="nav">
                <img src={navList[navIndex]}/>
            </nav>
        </div>
    )
}
export default Home;
